import React from 'react';
import './item-filter.css';

const ItemFilter = ({ done }) => {

    return(
        <div className ='item-filter'>
            
            <h3>{ done } items left</h3>
                <div className ='btn-group btn-1'>
                    <button>All</button>
                    <button>Active</button>
                    <button>Complete</button>            
                </div>
            <button className = 'btn-1'>Clear All</button>
        </div>
    )
};

export default ItemFilter;
